import { connect } from 'react-redux';
import { withRouter } from 'react-router-dom';
import mapStoreToProps from '../../../redux/mapStoreToProps';

function Step2(props) {

  const goForward = () => {
    dispatch({
      type: 'QUOTE_PROGRESS',
      payload: { divisor: 6, step_number: 2 }
    });
    props.history.push('./sub-service');
  }

  return (
    <div className='quote'>
      <button onClick={() => props.history.push('./type-of-service')}>Go to type of service</button>
      <button onClick={() => props.history.push('./location')}>Go to location</button>

      <p>Hi, {props.store.customerInfo.firstName} {props.store.customerInfo.lastName}!</p>


    </div>
  );
}

export default connect(mapStoreToProps)(withRouter(Step2));
